contracts/CCK/CC2/Governance.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Governance {
    address public owner; // 合约的拥有者地址
    string public tokenName; // 当前代币名称
    address[] public voters; // 投票人员地址列表
    mapping(address => bool) public hasVoted; // 记录每个地址是否已投票
    uint256 public voteCount; // 当前投票数量
    uint256 public totalVotesRequired = 5; // 需要的总票数
    bool public proposalActive; // 当前提案是否有效
    uint256 public changeTimestamp; // 更改名称的时间戳
    string public newProposedName; // 新提议名称

    event NameChanged(string newName); // 名称更改事件
    event ProposalCreated(string newName); // 提案创建事件
    
    modifier onlyOwner() { // 限制只有拥有者可以调用
        require(msg.sender == owner, "Not the owner");
        _;
    }

    modifier onlyVoter() { // 限制只有投票人员可以调用
        require(isVoter(msg.sender), "Not a voter");
        _;
    }

    constructor(string memory initialName, address[] memory _voters) {
        owner = msg.sender; // 设置合约拥有者为部署者
        tokenName = initialName; // 初始化代币名称
        voters = _voters; // 设置投票人员地址
        proposalActive = false; // 初始化提案状态为无效
        voteCount = 0; // 初始化投票计数为零
    }

    function isVoter(address _voter) internal view returns (bool) {
        // 检查地址是否为投票人员
        for (uint256 i = 0; i < voters.length; i++) {
            if (voters[i] == _voter) {
                return true; // 找到投票人员，返回true
            }
        }
        return false; // 未找到，返回false
    }

    function proposeNewName(string memory newName) public onlyOwner {
        // 提出新的代币名称提案
        require(!proposalActive, "Proposal already active"); // 确保没有活跃提案
        resetVotes(); // 重置投票记录
        voteCount = 0; // 重置投票计数
        newProposedName = newName; // 存储新的提议名称
        proposalActive = true; // 设置提案状态为有效
        emit ProposalCreated(newName); // 触发提案创建事件
    }

    function resetVotes() internal {
        // 清除之前的投票记录
        for (uint256 i = 0; i < voters.length; i++) {
            hasVoted[voters[i]] = false; // 将每个投票者的状态重置为未投票
        }
    }

    function vote() public onlyVoter {
        // 投票函数
        require(proposalActive, "No active proposal"); // 确保有活跃提案
        require(!hasVoted[msg.sender], "Already voted"); // 确保未重复投票
        
        hasVoted[msg.sender] = true; // 标记为已投票
        voteCount++; // 增加投票计数

        if (voteCount >= totalVotesRequired) {
            // 如果达到所需投票数
            changeTimestamp = block.timestamp + 2 minutes; // 设置更改时间戳为当前时间加两分钟
            // 不需要emit，因已在提案时触发
        }
    }

    function changeName() public {
        // 更改代币名称的函数
        require(block.timestamp >= changeTimestamp, "Change not allowed yet"); // 确保时间已到
        require(voteCount >= totalVotesRequired, "Not enough votes"); // 确保已满足投票要求

        tokenName = newProposedName; // 更新代币名称为提议名称
        proposalActive = false; // 结束提案状态
        emit NameChanged(newProposedName); // 触发名称更改事件
    }
}

